import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';

function Home() {
  const navigate = useNavigate();

  return (
    <div className="home">
      <div className="hero-section">
        <h1>Welcome to Our Tiffin Service</h1>
        <p>Delicious home-cooked meals delivered to your doorstep.</p>
        <button className="cta-button" onClick={() => navigate('/login')}>
          Order Now
        </button>
      </div>
      <div className="features-section">
        <div className="feature">
          <h2>Fresh Ingredients</h2>
          <p>We use only the freshest ingredients to prepare our meals.</p>
        </div>
        <div className="feature">
          <h2>Variety of Dishes</h2>
          <p>Choose from a wide range of dishes to satisfy your cravings.</p>
        </div>
        <div className="feature">
          <h2>Timely Delivery</h2>
          <p>Your meals are delivered on time, every time.</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
